script: |
  super -f text -I q10520.spq | sort > q10520.out

inputs:
  - name: q10520.spq
    data: |
      SELECT DISTINCT * FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col0 - cor0.col0 * + col2 BETWEEN col0 * cor0.col1 AND col2;
  - name: tab2

outputs:
  - name: q10520.out
    data: |
      7	31	27
      78	59	26
      79	17	38
